import React from 'react';
import './SearchPage.style.scss';

const SearchPage = (props) => {
    const { onHandleChange, state } = props;
    return (
        <>
            <div>Search Page</div>
            <div>
                <input type='search' onChange={ () => onHandleChange() }/>
            </div>
        </>
    );
};

export default SearchPage;
